INSERT INTO `books` (`ISBN`, `COSTPRICE`, `created`, `DESCRIPTION`, `FORMAT`, `GENRE`, `PUBYEAR`, `PUBLISHER`, `RETAILPRICE`, `STOCKLEVEL`, `THUMBNAIL`, `TITLE`)
VALUES
	('9780061703157',90,'2016-10-19 15:02:31','The United States government is given a warning by the pre-eminent biophysicists in the country: current sterilization procedures applied to returning space probes may be inadequate to guarantee uncontaminated re-entry to the atmosphere. Two years later, seventeen satellites are sent into the outer fringes of space to \"collect organisms and dust for study.\" One of them falls to earth, landing in a desolate area of Arizona. Twelve miles from the landing site, in the town of Piedmont, a shocking discovery is made: the streets are littered with the dead bodies of the town\'s inhabitants, as if they dropped dead in their tracks. The terror has begun . . .','Paperback','Fiction','2008-10-28','Harper Collins',19,3,X'','The Andromeda Strain'),
	('9780061782558',18,'2016-10-19 15:05:20','Deep in the African rain forest, near the legendary ruins of the Lost City of Zinj, an expedition of eight American geologists are mysteriously and brutally killed in a matter of minutes. Ten thousand miles away, Karen Ross, the Congo Project Supervisor, watches a gruesome video transmission of the aftermath: a camp destroyed, tents crushed and torn, equipment scattered in the mud alongside dead bodies—all motionless except for one moving image—a grainy, dark, man-shaped blur. In San Francisco, primatologist Peter Elliot works with Amy, a gorilla with an extraordinary vocabulary of 620 \"signs,\" the most ever learned by a primate, and she likes to finger paint. But recently her behavior has been erratic and her drawings match, with stunning accuracy, the brittle pages of a Portuguese print dating back to 1642 . . . a drawing of an ancient lost city. A new expedition—along with Amy—is sent into the Congo, where they enter a secret world, and the only way out may be through a horrifying death . . .','Paperback','Fiction','2009-04-28','Harper Collins',18.5,2,X'','Congo'),
	('9780061990557',8,'2016-10-19 15:03:38','In the middle of the South Pacific, a thousand feet below the surface of the water, a huge vessel is discovered resting on the ocean floor. It is a spaceship of phenomenal dimensions, apparently undamaged by its fall from the sky. And, most startling, it appears to be at least three hundred years old. But even more fantastic—and frightening—is what waits inside . . .','Paperback','Fiction','2011-03-29','Harper Collins',43.39,4,X'','Sphere'),
	('9780071809252',20,'2016-10-19 15:11:50','Essential Java Programming Skills--Made Easy! Fully updated for Java Platform, Standard Edition 8 (Java SE 8), Java: A Beginner\'s Guide, Sixth Edition gets you started programming in Java right away. Bestselling programming author Herb Schildt begins with the basics, such as how to create, compile, and run a Java program. He then moves on to the keywords, syntax, and constructs that form the core of the Java language. This Oracle Press resource also covers some of Java\'s more advanced features, including multithreaded programming, generics, and Swing. Of course, new Java SE 8 features such as lambda expressions and default interface methods are described. An introduction to JavaFX, Java\'s newest GUI, concludes this step-by-step tutorial. Designed for Easy Learning: Key Skills & Concepts -- Chapter-opening lists of specific skills covered in the chapter Ask the Expert -- Q&A sections filled with bonus information and helpful tips Try This -- Hands-on exercises that show you how to apply your skills Self Tests -- End-of-chapter quizzes to reinforce your skills Annotated Syntax -- Example code with commentary that describes the programming techniques being illustrated The book\'s code examples are available FREE for download.','Paperback','Computers','2014-05-06','McGraw-Hill Education',40,0,X'','Java: A Beginner\'s Guide, Sixth Edition'),
	('9780131103627',3,'2016-10-19 15:15:06','Introduces the features of the C programming language, discusses data types, variables, operators, control flow, functions, pointers, arrays, and structures, and looks at the UNIX system interface','Paperback','Computers','2016-10-03','No One',4.99,99,X'','The C Programming Language'),
	('9780307346612',19.99,'2016-10-19 15:13:34','An account of the decade-long conflict between humankind and hordes of the predatory undead is told from the perspective of dozens of survivors who describe in their own words the epic human battle for survival.','Paperback','Fiction','2016-10-17','Broadway Books',27.99,6,X'','World War Z'),
	('9780307743657',17.5,'2016-10-19 15:06:14','Jack Torrance sees his stint as winter caretaker of a Colorado hotel as a way back from failure, his wife sees it as a chance to preserve their family, and their five-year-old son sees the evil waiting just for them.','Paperback','Fiction','2016-09-28','Golden Books',23.8,12,X'','The Shining'),
	('9780307743688',12,'2016-10-19 15:07:12','A monumentally devastating plague leaves only a few survivors who, while experiencing dreams of a battle between good and evil, move toward an actual confrontation as they migrate to Boulder, Colorado.','Paperback','Fiction','2015-12-28','Anchor',12.3,0,X'','The Stand'),
	('9780345538987',6,'2016-10-19 15:04:52','An American bioengineering research firm erects a theme park on a Caribbean island, complete with living dinosaurs, and invites a group of scientists to be its first terrified guests.','Paperback','Fiction','2016-09-27','Ballantine Books',6.12,10,X'','Jurassic Park'),
	('9780345538994',6.5,'2016-10-19 15:04:18','Six years after the secret disaster at Jurassic Park and the destruction of the dinosaurs, the dismantling of the park, and the closing of the island, rumors persist that some form of life has survived.','Paperback','Fiction','2016-10-04','Ballantine Books',12.99,0,X'','The Lost World'),
	('9780553804362',8,'2016-10-19 15:11:16','A shorter, more accessible edition of a now-classic survey of the origin and nature of the universe features new full-color illustrations and an expanded, easier to understand treatment of the volume\'s more important theoretical concepts.','Paperback','Science','2016-10-04','Bantam',8,8,X'','A Briefer History of Time');

