	('9780767908184',12,'2016-10-19 15:08:20','The author of A Walk in the Woods traces the Big Bang through the rise of civilization, documenting his work with a host of the world\'s most advanced scientists and mathematicians to explain why things are the way they are. Reprint. 125,000 first printing.','Paperback','Science','2016-10-04','Broadway',17,1,X'','A Short History of Nearly Everything'),
	('9780767919395',3,'2016-10-19 15:09:10','Explores the ways in which homes reflect history, from a bathroom\'s revelations about medicine and hygiene to a kitchen\'s exposure of the stories of trade and nutrition.','Paperback','Science','2016-10-03','Anchor Books',3,3,X'','At Home'),
	('9781400049622',11,'2016-10-19 15:14:04','An illustrated, comprehensive guide to surviving an attack by hordes of the predatory undead explains zombie physiology and behavior, the most effective weaponry and defense strategies, how to outfit one\'s home for a long siege, and how to survive in any territory or terrain. Original. 35,000 first printing.','Paperback','Fiction','2016-10-08','Broadway Books',19.9,4,X'','The Zombie Survival Guide');

